import './App.css'
import Cliente from './componentes/Cliente';
import Usuario from './componentes/Usuario';
import Login from './componentes/Login';
import Cabecalho from './componentes/Cabecalho';
import { BrowserRouter, Link, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div>
      <Cabecalho>
        <BrowserRouter>
          <nav className="menu">
            <Link to="/" className="linkMenu"> Home </Link>
            <Link to="/cliente" className="linkMenu"> Clientes </Link>
            <Link to="/usuario" className="linkMenu"> Usuario </Link>
            <Link to="/login" className="linkMenu"> Sair </Link>
          </nav>
          <Switch>
            <Route path="/" exact>

            </Route>
            <Route path="/cliente" exact>
              <Cliente />
            </Route>
            <Route path="/usuario" exact>
              <Usuario />
            </Route>
            <Route path="/login" exact>
              <Login />
            </Route>
          </Switch>
        </BrowserRouter>
      </Cabecalho>

    </div>
  );
}

export default App;
